description:
TPO 08/51 - T1 (Prunus blieriana) - remove sucker;
T3 - T8 (Platanus x hispanica) - lift to 4m;
T12 (Quercus robur) - reduce 1 limb by 5m and suckers to 4m;
T13 (Quercus robur) remove sucker and epicormic growth up to 4m;
T22 (Prunus 'Hisakura') - remove hung up broken branch over road;
T26 (Acer pseudoplatanus) - lift crown by removing the lowest 1 limb and remove sucker;
T28 (Alnus incana) and T99 (Quercus robur) - remove deadwood;
T29 (Sambucus nigra) - reduce by 4m;
T37, T39, T42, T44, T49, T52, T54 ,T57 (Aesculus hippocastanum) and T31 (Fraxinus excelsior) - lift to 4m;
T59 and T64 (Acer pseudoplatanus) - remove suckers;
T69 (Alnus cordata) - remove lowest 4 limbs;
T70 (Malus tschonoskii) - lift crown to 3m and sucker;
T80 (Alnus cordata) and T95 (Acer pseudoplatanus 'Leopoldii') - lift crown to 4m and sucker;
T105.5 (Salix caprea) - reduce crown by 3m;
T119 (Acer saccharinum) - reduce 1 limb;
T128.2 (Prunus avium) - lift crown by removing the lowest 2 limbs and remove sucker;
T129 (Alnus glutinosa) - lift crown by removing the lowest 1 limb and remove sucker;
T276 and T277 (Fraxinus oxycarpa 'Raywood') - up to 5m (cut back to suitable union points).
T293 - T296 - lift to 4m and suckers;
T140 - T141 (Prunus xyedoensis) - reduce specific limbs, lift crown by removing the lowest 1 limb and remove sucker;
T145 (Malus xpurpurea) - lift crown to 4m and remove sucker;
T149 (Fraxinus excelsior) - remove deadwood;
T150 - T155 (Aesculus hippocastanum) - lift crown to 4m and remove sucker;
T175 (Acer platanoides) - lift crown to 4m and remove sucker;
T183 - T184 (Aesculus hippocastanum) - lift crown by removing lowest limb;
T225- T226 (Acer pseudoplatanus) - lift crown by removing lowest limb and remove deadwood;
T228 (Tilia cordata) - lift crown to 4m and sucker;
T210 (Aesculus hippocastanum) - lift crown to 4m and sucker;
T213 (Aesculus hippocastanum) - lift crown by removing 2 lowest limbs and sucker;
T236 (Aesculus hippocastanum) - reduce crown by 4m;
T248 (Aesculus x carnea) - reduce one specific limb by 5m;
T280 - T284 (Platanus x hispanica), T293 - T296 (Betula pendula) and T300 - T301 (Ulmus 'New Horizon') - lift to 4m; and
T345 (Cupressus macrocarpa) - remove broken hanging branch.
